import React from 'react'
import TodoListItem from './todo-list-item'

const TodoList = () => {
    const items = [
        'Todo first',
        'Todo second',
        'Todo third',
    ]

    return (
        <ul>
            <li>{items[0]}</li>
            <li>{items[1]}</li>
        </ul>

    )
}

export default TodoList
